(1042, 3, 'Black Hole', 8, 125, '1', '1', 0, '0', 40, 'default_3x3', 'AGNEA', 'ADNED', '', '', '', '', '', '0', '', ''),
(204, 503, 'Reglas Banzai', 1, 42, '1', '1', 1, '0', 11, 'recycler_info', 'catalog_battleBanzai_header_en', 'icon_78', 'Lee las instrucciones y descubre cómo jugar al Battle Banzai. ¡No hay tiempo que perder!', '', '', '¿Cómo crear tu propia Sala de Battle Banzai?\r\n1. Ve a tu Sala.\r\n2. Coloca casillas Banzai en el suelo y vallas para limitar el campo de juego.\r\n3. Añade un Vestuario Banzai en cada lado para cada equipo. Hay cuatro opciones: azul, rojo, amarillo y verde.\r\n4. Coloca el Contador y los Marcadores en el terreno de juego.\r\n5. Una vez esté todo listo, di a tus amigos que se preparen.\r\n6. Haz clic en el Contador e inicia el juego.', '', '0', '', ''),
(1230, 503, 'Reglas Fútbol', 1, 42, '1', '1', 1, '0', 21, 'recycler_info', 'catalog_football_001', 'icon_56', '', 'Monta un campo y coloca en sus laterales tantos Vestuarios como equipos quieras que participan en el juego. Ah, y no te olvides del Balón, claro. ¡Dominar este juego no lleva mucho tiempo!', '¿Sabías que las mascotas también pueden jugar? ¡Haz la prueba!', 'Aquí­ tienes algunos consejos:\r\n1. Haz un disparo avanzando hasta la casilla en la que está el Balón, o da un pase atravesando esa misma casilla.\r\n2. Hazte con el control del balón avanzando hasta una casilla junto a este y luego haciendo doble clic sobre él.\r\n3. Haz que rebote el Balón ante obstáculos como otros Furni, jugadores o vallas.', '', '0', '', ''),
(1231, 503, 'Reglas Freeze', 1, 42, '1', '1', 1, '0', 2, 'recycler_info', 'catalog_freeze_en', 'ctlg_teaser_es', '', 'Descubre aquí­ cómo crear un recinto donde poder jugar a ''Freeze'' y, además, cómo jugar exactamente.', 'Recuerda: ¡pon siempre los Bloques sobre una Casilla Freeze! Si no, no funcionarán.', '¡Así­ es como puedes crear tu propia partida!\r\n1. Ve a tu Sala.\r\n2. Coloca Casillas y Bloques Freeze en el suelo y utiliza Paredes para delimitar el terreno de juego. ¡Pon siempre los Bloques sobre una Casilla!\r\n3. Añade un acceso para cada equipo en tu Sala. Puede haber un máximo de cuatro equipos: amarillo, azul, rojo y verde.\r\n4. Coloca un Contador y un Marcador en el terreno de juego.\r\n5. Finalmente, coloca una Casilla de Salida fuera del terreno de juego. Ahí­ serán enviados los jugadores cuando ya no les quede ninguna vida.\r\n6. ¿Listo? Llama a tus amigos y deja que elijan equipo. Cada uno puede tener hasta un máximo de cinco jugadores.\r\n7. Haz clic en el Contador y deja que empiece el juego.', '', '0', '', ''),
