INSERT INTO `cms_faq` (`id`, `type`, `catid`, `title`, `content`, `show_in_footer`) VALUES
(5, 'item', 6, '?Qu? es un ''YoSoy''?', 'Es una frase corta o palabra que sirve para definirte, para mostrar a otra gente tu personalidad, intereses, hobbies? Tambi?n te hacen m?s f?cil la b?squeda de otros usuarios o Grupos que comparten tus mismos intereses y aficiones.\r\nPuedes nombrar breves ideas como tu programa de TV favorito, el estilo de m?sica que m?s te gusta o tu animal preferido.\r\n', 0),
(6, 'cat', 0, '''YoSoy''', '', 1),
(7, 'item', 6, '?Alguien tiene un ''YoSoy'' como el m?o?', 'Si pinchas en tu ''YoSoy'', saldr? un listado en el Buscador con todos los Habbos que se han puesto la misma palabra o frase que t? como definici?n.\r\n', 0),
(8, 'item', 6, '?C?mo a?ado un ''YoSoy'' a mi Habbo?', 'Entra en la cuenta de tu personaje y, a continuaci?n, dir?gete a tu Habbo Home. En el Elemento de tu Perfil, ver?s un espacio para colocar tu primer ''YoSoy''. Tras escribirlo, haz clic en el bot?n que permite a?adirlo. ?Ya est?!\r\nSi se trata de un Grupo, el espacio a rellenar con el ''YoSoy'' lo ver?s en el Elemento ''Info del Grupo''.', 0),
(2, 'item', 1, '?C?mo a?ado un link a mi P?gina?', 'El men? que aparece cuando est?s editando un mensaje en el Libro de Invitados, por ejemplo, te permite crear el link a una P?gina o a una Sala. \r\n\r\nUtiliza el Buscador para encontrar el link adecuado y, una vez te aparezca en la Lista del Buscador, haz clic sobre ?l para que se a?ada a tu texto.', 0),
(1, 'cat', 0, '''Mi P?gina''', '', 1),
(3, 'item', 1, '?C?mo puedo cambiar el formato de los textos?', 'Puedes hacer que lo que escribas en las Notas y que tus mensajes en los Libros de Invitados aparezca con diferentes tama?os, en negrita, cursiva o subrayado.\r\nElige la opci?n que prefieras con los botones que ver?s al editar la Nota o el mensaje para el Libro. Selecciona el texto que vaya a cambiar su formato y pulsa el bot?n correspondiente. Si lo que quieres es que la palabra ''gente'' salga en negrita, tras pulsar la ''B'', en el texto la palabra aparecer? como gente. Una vez publiques la Nota, se ver? correctamente.\r\n', 0),
(4, 'item', 1, '?Qu? es ''Mi P?gina''?', 'Es tu propia web en Habbo. Puede ser como t? quieras. Ah, y cuentas con todo lo que puedas imaginar para personalizarla: Etiquetas, Notas, Fondos, Elementos...\r\n\r\nAqu? tienes una peque?a gu?a para saberlo todo sobre ella:\r\n\r\nA) INTRODUCCI?N:\r\n\r\nPara entrar a tu P?gina, simplemente pincha en el link que ver?s en la P?gina Principal de tu personaje en la web en cuanto te has registrado con tu cuenta.\r\nUna vez que lo has hecho, ?pulsa en el bot?n ''Editar'' para dar rienda suelta a tu creatividad! Claro que, habr? que tener cuidado con los contenidos inapropiados.\r\nTodo lo que aparece en ella puede ser cambiado de lugar. S?lo necesitas pinchar sobre un elemento y arrastrarlo hasta el lugar que quieras.\r\n\r\nB) TU INVENTARIO:\r\n\r\nAl entrar en el modo de edici?n, podr?s elegir el dise?o que quieras para tu P?gina. Pinchando en las Notas, Etiquetas, Elementos o Fondos podr?s ver el material del que dispones, ?tu Inventario!, todas las maravillas de las que eres propietario..\r\nAl principio, contar?s con material completamente gratuito, para comenzar tu dise?o, pero para conseguir m?s tendr?s que echar mano de tus Habbo Cr?ditos.\r\n\r\nC) UTILIZA NOTAS:\r\n\r\nPara a?adir una Nota a tu P?gina, pincha en el bot?n ''Notas'' y se te abrir? una ventana. En ella, adem?s de figurar el n?mero de notas que te quedan, te aparecer? una nueva para que escribas tu texto. Elige del men? desplegable el tipo de nota que quieres... ?y comienza a escribir!\r\nAl acabar, puedes pinchar en ''Previa'' para ver c?mo queda y, si tiene tu visto bueno (:O), haz clic en ''Colocar''. Y si no, vuelve a editar.\r\nPara comprar m?s Notas o para cancelar la compra, pulsa en el bot?n correspondiente.\r\n?Atenci?n! Una vez que has pulsado ''Eliminar'', no podr?s volver a editarla. Sencillamente... ?desaparecer?!\r\n\r\nD) ETIQUETAS:\r\n\r\nPara a?adir una Etiqueta en tu P?gina, abre primero el Inventario. Pincha en la etiqueta que quieres que aparezca y sit?ala en el lugar de la p?gina que prefieras.\r\n?Qu? debes hacer si quieres comprar m?s Etiquetas? Abre tu Inventario, pincha en ''Obtener m?s etiquetas'', selecciona el modelo que quieras, y luego pulsa en ''Comprar''.\r\nPara editar tu Etiqueta, pincha en el icono de la llave inglesa que aparece junto a ella. Puedes tambi?n sacarla de la p?gina -volver? a tu Inventario, o no, lo que decidas-.\r\n\r\nE) ELEMENTOS:\r\n\r\nLos Elementos se muestran en peque?as cajas que recogen la informaci?n que t? proporcionas a quienes vean tu P?gina. Hay 4 clases de elementos: Amigos (se ense?an im?genes de tus Habbo amigos); Salas (proporciona links a tus Salas); M?ximas Puntuaciones (muestra tus puntuaciones en el Battle Ball: Rebound!, SnowStorm y Aquachof); y Habbo Club (se informa de si eres miembro o no del Habbo Club).\r\nPincha en el bot?n ''Elementos'' para poder colocarlos en tu P?gina. Una vez est?n en ella, pincha en el icono de la llave inglesa para poder cambiar el ''look'' del Elemento o para sacarlo de tu P?gina y devolverlo a tu Inventario.\r\n\r\nF) FONDOS:\r\n\r\nPara colocar un Fondo, pincha en el bot?n ''Fondos'' para abrir el Inventario. A continuaci?n, selecciona el que quieras que aparezca en tu P?gina. Si quieres uno nuevo, haz clic en ''Conseguir m?s Fondos'' para que se te abra el Cat?logo. Una vez encuentres el que quieras obtener, pincha en el bot?n ''Comprar''. El Fondo se a?adir? directamente a tu Inventario.\r\n', 0),
(9, 'cat', 0, 'Afiliados', NULL, 1),
(10, 'item', 9, '?Quieres unirte a nuestra Red de afiliados?', 'Estamos seleccionando un exclusivo <i>network</i> de afiliados para <b>Habbo</b>.\r\n\r\nContacta con nosotros mediante el <a href="./iot/go" title="" class="style2">Habbo Help Tool.</a>\r\n', 0),
(11, 'cat', 0, 'Aumento de Pantalla', NULL, 1),
(12, 'item', 11, '?Por qu? ha aumentado el tama?o de la pantalla del Hotel?', 'Cuando Habbo empez? a funcionar, la resoluci?n media de la mayor?a de los usuarios de internet era del 800x 600. El tama?o de la pantalla del Hotel se dise?? teniendo esto en cuenta. Los tiempos han cambiado, y la resoluci?n media de la pantalla ha aumentado.Por este motivo, hemos aumentado el tama?o de la pantalla del Hotel.\r\nEl espacio extra que aparece a la izquierda de la pantalla, podemos utilizarlo para colocar la pantalla de la mensajer?a al instante, para poner el navegador abierto o el monedero sin que tapen el di?logo o la habitaci?n.\r\n', 0),
(13, 'cat', 0, 'Bot?n "Ignorar" ', NULL, 1),
(14, 'item', 13, '?C?mo ignoro a alguien?', 'Para utilizar el bot?n "ignorar, solo tienes que hacer clic sobre el Habbo a quien no quieres escuchar y pinchar sobre el bot?n que aparece en la esquina inferior izquierda de tu pantalla del Hotel.\r\n', 0),
(15, 'item', 13, '?Para qu? sirve el bot?n de ?Ignorar??', 'Todos los usuarios Habbo tienen una funci?n para no tener que leer las conversaciones de otras personas. Podr?s ignorar a cualquier Habbo hasta que vuelvas a necesitar escuchar lo que dice.\r\nPor ejemplo: si un Habbo comienza a insultarte o molestarte, pincha sobre el Habbo en cuesti?n y aparecer? debajo de su descripci?n, el bot?n de ignorar. P?lsalo e inmediatamente dejar?s de leerle.\r\nSi quieres volver a saber lo que dice, pulsa de nuevo al Habbo ignorado y debajo de su descripci?n aparecer? el bot?n ?Escuchar?. Haz clic y podr?s ver lo que cuenta.', 0),
(16, 'item', 13, '?A qui?n puedo ignorar?', 'Podr?s ignorar a cualquier Habbo, EXCEPTO a los siguientes:\r\nEl due?o de una Sala de Invitados.\r\nA un Moderador (empleado de Habbo Hotel).\r\nA un Habbo Staff (empleado de Habbo Hotel).\r\n', 0),
(17, 'item', 13, '?Tengo que volver a pulsar el bot?n de ignorar si tengo que entrar de nuevo en una Sala?', 'S?. Cuando sales de una Sala, todas aquellas selecciones que has hecho para ignorar son eliminadas. Por lo tanto, cuando entras de nuevo en una Sala de la que te hab?as ido, debes seleccionar de nuevo aquellos Habbos a los que no quieres leer.', 0),
(18, 'item', 13, '?Qu? pasa si soy ignorado?', 'Si un Habbo te ignora, por m?s que le hables el no leer? tu conversaci?n durante el tiempo que ?l quiera.\r\nLas reglas de Habbo dicen que no puedes molestar a otros Habbos que no quieran hablar contigo. Si tu crees que eres ignorado por otro usuario, tendr?s que buscar a otra persona que quiera hablar contigo.\r\n', 0),
(19, 'cat', 0, 'Consejos de Seguridad', NULL, 1),
(20, 'item', 19, '?Cu?l es la mejor forma de mantenerse seguro/a online? ?Sigue nuestros consejos y ser?s el/la m?s seguro/a de la red!', '<b>1-. ?Tus datos, tu tesoro!</b> Mant?n en secreto tu nombre real, direcci?n de correo postal, n?mero de tel?fono, nombre de tu colegio/instituto y, sobre todo, no des nunca a nadie una foto tuya. De esta forma, evitar?s que puedan timarte, hackearte o ponerte en peligro. \r\n\r\n<b>2-. Tus amigos/as, ?mejor pixelados!</b> Nunca quedes con nadie que hayas conocido en Internet. Si alguien intenta conocerte en la vida real, ?no le hagas ni caso! y cu?ntaselo a una persona adulta. Las personas pueden no ser las mismas dentro que fuera del Chat.\r\n\r\n<b>3-. ?Fotos, no!</b> Una vez que cuelgas una foto en la Red, ya no puedes controlar para qu? va a ser utilizada. Puede que sea modificada, expuesta en cualquier parte del mundo o utilizada para acosarte, chantajearte o hacerte da?o. No te la juegues. Si alguien intenta conseguir una imagen tuya por Internet, di ?NO!\r\n\r\n<b>4-. ?Cu?ntalo sin miedo!</b> Si alguien te hace sentir inc?modo o no te gusta lo que te dice, env?a una alerta a un/a moderador/a o cu?ntaselo a una persona adulta. \r\n\r\n<b>5-. ?Al loro con los timos!</b> Las webs que ofrecen Cr?ditos o Furni gratis, o las que simulan ser un ''Habbo Hotel'', han sido pensadas para enga?arte o robarte tu contrase?a. Nunca escribas en ninguna de ellas tus datos personales ni te descargues sus archivos: ?pueden contener virus o keyloggers!\r\n\r\n<b>6-. ?Ni caso!</b> Algunas personas se conectan a Internet s?lo para molestar a los dem?s. Si te encuentras con una de ellas, no le hagas ni caso. Haz clic sobre el bot?n ''Ignorar'' y sigue a lo tuyo.\r\n\r\n<b>7-. ?Mola ser guay!</b> Te lo pasar?s mejor y podr?s conocer m?s gente si eres amable y respetuoso con los dem?s. ?Todos/as somos iguales, s?lo nuestros pixeles nos dan un ''punto'' diferente!\r\n', 0),
(21, 'cat', 0, 'Contacta con nosotros ', NULL, 1),
(22, 'item', 21, '?Quieres contactar con el Equipo de Ayuda y Seguridad?', 'Utiliza el <a href="./iot/go" title="" class="style2">Ayudante del Habbo</a> para enviarnos tus preguntas y tus sugerencias. Para ello, aseg?rate de que has elegido la categor?a correcta de entre las que te proponemos en esa herramienta. As?, nos ser? m?s sencillo poder ayudarte.\r\n\r\nTen en cuenta que nos es imposible devolver los objetos que hayan sido robados de una cuenta por otro jugador. Esto nunca puede suceder si jam?s revelas tu contrase?a y tu informaci?n personal en Habbo. Trata estos datos como si fueran las llaves de tu casa ?no se las des a nadie! \r\n\r\nNo olvides que respondemos a los emails que recibimos en un plazo de dos d?as laborables (de lunes a viernes). S?lo son contestados durante el horario de oficina.\r\n', 0),
(23, 'item', 21, '?Por qu? deber?a enviar un solo e-mail?', 'Enviar m?s de un e-mail puede hacer que el equipo de Atenci?n al Usuario tarde m?s tiempo en responder, ya que tendr? que leer m?s correos.\r\n\r\nSi no recibes una respuesta despu?s de una semana, accede a tu carpeta de correo no deseado. Si a?n as? no has sido respondido, es posible que tengamos alg?n problema t?cnico. Vuelve a enviarnos de nuevo tu email.\r\n', 0),
(24, 'cat', 0, 'Controlando tu Habbo ', NULL, 1),
(25, 'item', 24, '?Qu? es un bloqueador de puertas?', 'Un bloqueador de puertas es un Habbo que se queda parado en el marco de la puerta de entrada y no deja que otros Habbos puedan acceder a la Sala.\r\n\r\n\r\nSi alg?n Habbo bloquea la puerta de tu Sala, puedes expulsarle. Si contin?a haci?ndolo, puedes mandar una alerta al Moderador, ya que va en contra de las normas de Habbo y puede ser baneado.', 0),
(26, 'item', 24, '?C?mo chateo?', 'Es muy sencillo. Para hablar con alguien, s?lo tienes que escribir el texto en el campo que aparece en la parte inferior de la pantalla y seleccionar la forma en la que quieres hablar (Decir, Gritar o Susurrar). Pulsa Enter cuando hayas terminado\r\n', 0),
(27, 'item', 24, '?Por qu? no escucho lo que la gente dice?', 'Si no oyes lo que el resto de las personas hablan, es probable que no est?s dentro del radio de la conversaci?n.\r\n\r\nS?lo podr?s escuchar lo que la gente dice, cuando te encuentres a cinco baldosas de quien est? hablando.\r\n\r\nSi est?s fuera del radio de la conversaci?n, las palabras se convertir?n en puntos y no podr?s leer nada hasta que no te acerques.\r\n', 0),
(28, 'item', 24, '?C?mo puedo cambiar mi aspecto?', 'Los cambios en el aspecto de un Habbo se realizan directamente desde la web. Una vez te conectes con tu personaje, entra en la secci?n ''Ajustes'' y, a continuaci?n, en la de ''Mi Ropa''. ?Sorprende a todos con tu aspecto!\r\n\r\nSi entras a formar parte del <a href="./credits/habboclub" title="" class="style2">Habbo Club</a>, podr?s disfrutar de un buen n?mero de nuevos peinados, ropa y accesorios. ?Haz la prueba!', 0),
(29, 'item', 24, '?C?mo puedo andar, sentarme y tumbarme?', 'Para andar en una Sala, pulsa en la casilla del suelo a la que quieras ir. Para sentarte o tumbarte, pulsa en el cuadro que est? debajo del Furni sobre el que te quieres sentar o encima del que pienses tumbarte.', 0);
